const CustomPage = (prop) => {
    const page = prop.page;
    const setPage = prop.setPage;
    const totalpages = prop.totalpages;

    return ( 
        <div className="flex justify-center ">
            <button onClick={() => {
                if(page!=1){
                    setPage(page-1);
                }
            }} className ="border-2 bg-blue-700 text-slate-50 border-slate-800 px-2 py-1 rounded-lg">
                <svg className="w-4 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M12.066 11.2a1 1 0 000 1.6l5.334 4A1 1 0 0019 16V8a1 1 0 00-1.6-.8l-5.333 4zM4.066 11.2a1 1 0 000 1.6l5.334 4A1 1 0 0011 16V8a1 1 0 00-1.6-.8l-5.334 4z"></path></svg>
                </button>
            <button className="px-2">{page}</button>
            <button onClick={() => {
                if(page != totalpages){
                    setPage(page+1);
                }
            }} className="border-2 bg-blue-700 text-slate-50 border-slate-800 px-2 py-1 rounded-lg" >
                <svg className="w-4 h-4 " fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M11.933 12.8a1 1 0 000-1.6L6.6 7.2A1 1 0 005 8v8a1 1 0 001.6.8l5.333-4zM19.933 12.8a1 1 0 000-1.6l-5.333-4A1 1 0 0013 8v8a1 1 0 001.6.8l5.333-4z"></path></svg>
            </button>

        </div>
     );
}
 
export default CustomPage;
